import React from 'react';
import './search.css';
export default class Search extends React.Component {
  constructor(props) {
    super(props);
    this.state = {}
  }
  _focus() {
    this._searchBox.style.marginLeft=25+'px'
  }
  _blur() {
    this._searchBox.style.marginLeft = 100 + 'px'
  }
  render() {
    return <div className='search-wrap'>
      <div className='search-box'>
        <div className='tab-wrap'>
          <span className="left" > 《 </span >
          <span className="right">》</span >
        </div>
        <div className='search-item'>
          <div className='search-item-box' ref={ref => this._searchBox = ref} style={{
            marginLeft:100
          }}>
            <span className='search'></span>
            <input placeholder='搜索' onFocus={this._focus.bind(this)} onBlur={this._blur.bind(this)}/>
          </div>
        </div>
      </div>

    </div>
  }
  componentDidMount() {

  }
}
